import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Register from './Register';
import Login from './Login';
import AttendanceForm from './AttendanceForm';
import AttendanceDashboard from './AttendanceDashboard';
import './App.css';

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [user, setUser] = useState(null);
  const [currentView, setCurrentView] = useState('form');

  useEffect(() => {
    const token = localStorage.getItem('token');
    const userData = localStorage.getItem('user');

    if (token && userData) {
      setIsAuthenticated(true);
      setUser(JSON.parse(userData));
    }
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    setIsAuthenticated(false);
    setUser(null);
  };

  // Protected Route component
  const ProtectedRoute = ({ children }) => {
    return isAuthenticated ? children : <Navigate to="/login" />;
  };

  // Public Route component (redirect if authenticated)
  const PublicRoute = ({ children }) => {
    return !isAuthenticated ? children : <Navigate to="/dashboard" />;
  };

  return (
    <Router>
      <div className="App">
        {isAuthenticated ? (
          <>
            <header className="app-header">
              <div className="header-content">
                <h1>Employee Attendance Tracker</h1>
                <div className="user-info">
                  <span>Welcome, {user?.employeeName}</span>
                  <button onClick={handleLogout} className="logout-btn">
                    Logout
                  </button>
                </div>
              </div>
              <nav>
                <button 
                  className={currentView === 'form' ? 'active' : ''}
                  onClick={() => setCurrentView('form')}
                >
                  Mark Attendance
                </button>
                <button 
                  className={currentView === 'dashboard' ? 'active' : ''}
                  onClick={() => setCurrentView('dashboard')}
                >
                  View My Records
                </button>
              </nav>
            </header>

            <main className="main-content">
              {currentView === 'form' ? <AttendanceForm /> : <AttendanceDashboard />}
            </main>
          </>
        ) : (
          <Routes>
            <Route 
              path="/register" 
              element={
                <PublicRoute>
                  <Register />
                </PublicRoute>
              } 
            />
            <Route 
              path="/login" 
              element={
                <PublicRoute>
                  <Login />
                </PublicRoute>
              } 
            />
            <Route path="/" element={<Navigate to="/login" />} />
            <Route path="/dashboard" element={<Navigate to="/login" />} />
          </Routes>
        )}

        <footer className="app-footer">
          <div className="footer-content">
            <p>&copy; 2024 Employee Attendance Tracker. BIWA2110 Web Application Development.</p>
            <p>Faculty of Information & Communication Technology - Limkokwing University</p>
            <p>Secure Authentication System | Protected Routes | User Management</p>
          </div>
        </footer>
      </div>
    </Router>
  );
}

export default App;
